import React, { useState } from 'react';
import styled from 'styled-components'
import { PageOuterWrapper, SimpleFlexWrapper } from './PageWrapper'

const ButtonElement = styled.button`
    height: 16px;
    font-size: 20px;
    font-weight: 500
    letter-spacing: .25px;
    background-color: #eb3323;
    min-width: 100px;
    border-radius: 4px;
    padding: 20px  20px 20px 20px ;
    // padding: 9px 16px 9px 16px;
    margin-left: 5px ;
    text-align: center;
    // margin-bottom: 15px;


`;

const Button = (props) => (
    <SimpleFlexWrapper justify={ 'flex-end'} top={'14px'}>
        <ButtonElement  {...props} >{props.name}</ButtonElement>
    </SimpleFlexWrapper>
);

export { Button };
